import React, { Component } from 'react';
import './head.css'
let data_1 = [
    {
        li_name: "ресив",
        model: [11, 22, 33, 44, 55],
        layer_3: [],
        Lyer_4: [5],
    },
    {
        li_name: "каналы",
        ul_notis: "234",
        model: [11, 22, 33, 44, 55],
        layer_3: ["rrrr"],
        Lyer_4: [],
    },
    {
        li_name: "каналы",
        ul_notis: "456",
        model: [4, 55],
        layer_3: [],
        Lyer_4: [11, 22, 33, 44, 55,  22, 33],
    },
    {
        li_name: "баги",
        ul_notis: "678",
        model: [11, 22, 33, 44, 55],
        layer_3: ["ttttt", "yyyyyyy"],
        Lyer_4: [11, 22, 33, 44, 55],
    },
    {
        li_name: "заказы",
        ul_notis: "890",
        model: [],
        layer_3: [],
        Lyer_4: [],
    },
    {
        li_name: "IT",
        ul_notis: "wwww",
        model: [115],
        layer_3: [],
        Lyer_4: [11, 22, 33, 44, 55],
    },
]
const tt = data_1.map(el =>
    <ul>
        <li><a className="left">{el.li_name}</a></li>
        <li><a className="">{el.ul_notis}</a></li>
        <li><a className="">{el.model}</a></li>
        <li><a className="">{el.layer_3}</a></li>
        <li><a className="">{el.Lyer_4}</a></li> 
    </ul>)



const Head_ul = () => {
    return (
        <div>
            {tt}
        </div>
    )
}
export default Head_ul;










